import React from 'react';

import './App.css';
import Header from "./Components/Header/Header";

let categories: string[][] = [['СЕТЫ', 'sets'], ['РОЛЛЫ', "rolls"], ['СУШИ', 'sushi'], ['ПИЦЦА', 'pizza'], ['САЛАТЫ', 'salads'], ['БУРГЕРЫ', 'burgers'], ['ВОКИ', 'woks'], ['СУПЫ', 'soups'], ['ГАРНИРЫ', 'garnish'], ['НАПИТКИ', 'drinks'], ['ПОКЕ', 'pokes']]


function App() {
    return (
        <div className="App">
            <Header categories={categories}/>

        </div>
    );
}

export default App;
